const Notes = ({note}) =>{
  <li>{note.content}</li>
}

const App = ({ notes }) => {
  return (
    <div>
      <h1>Notes</h1>

      <ul>
        <li>{notes[0].content}</li>
        <li>{notes[1].content}</li>
        <li>{notes[2].content}</li>
      </ul>

      <ul>
        {notes.map((note) => 
        <li key = {note.id}>
          {note.content}
        </li>)}
      </ul>
      <ul>
        {notes.map(note => <Notes />)}
      </ul>


    </div>
  )
}

export default App
